        index: "Description",
        data: (() => {
          try {
            let destruct = profile['data']['description']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Primary Line",
        data: (() => {
          try {
            let destruct = profile['data']['lines']['line'][0]['dirn']['pattern']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "E164 Mask",
        data: (() => {
          try {
            let destruct = profile['lines']['line'][0]['e164Mask']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Location",
        data: (() => {
          // try {
            let destruct = profile['meta']['hierarchy']
            console.log(destruct)
            return destruct ? destruct : ""
          // }
          // catch {return ""}
        })()
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retireve devices.")
  })
}
